import React from 'react';

class GenerateQuestions extends React.Component {
  constructor(){
    super();
    this.state = {quesans: []}
  }

componentWillMount(){
  fetch('http://127.0.0.1:5000/generate-questions', {
  method: 'POST', // The method
  mode: 'no-cors', // It can be no-cors, cors, same-origin
  credentials: 'same-origin', // It can be include, same-origin, omit
  headers: {
    'Content-Type': 'application/json', // Your headers
    'Access-Control-Allow-Origin': '*',
  }})
      .then( response => response.json() )
    .then( result => this.setState({ quesans: result}))
    
}
  render(){
    let quesans = this.state.quesans
    console.log(quesans)
    return (
      <div>
        <p>hello</p>
        {quesans.map(questionanswer =><h4>{questionanswer.questions}</h4>)}
      </div>
    )
  }
}

export default GenerateQuestions;
